import React, { useEffect, useState } from 'react';
import { Button, Row, Col, Card, Dropdown, Badge, Spinner } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import { OverlayScrollbarsComponent } from 'overlayscrollbars-react';
import HtmlHead from 'components/html-head/HtmlHead';
import BreadcrumbList from 'components/breadcrumb-list/BreadcrumbList';
import CsLineIcons from 'cs-line-icons/CsLineIcons';
import ChartCustomHorizontalTooltip from './chart/ChartCustomHorizontalTooltip';
import ChartSmallLine1 from './chart/ChartSmallLine1';
import ChartSmallLine2 from './chart/ChartSmallLine2';
import ChartSmallLine3 from './chart/ChartSmallLine3';
import ChartSmallLine4 from './chart/ChartSmallLine4';
import ChartBubble from './chart/ChartBubble';
import ChartSmallDoughnutChart1 from './chart/ChartSmallDoughnutChart1';
import ChartSmallDoughnutChart2 from './chart/ChartSmallDoughnutChart2';
import ChartSmallDoughnutChart3 from './chart/ChartSmallDoughnutChart3';
import ChartSmallDoughnutChart4 from './chart/ChartSmallDoughnutChart4';
import ChartSmallDoughnutChart5 from './chart/ChartSmallDoughnutChart5';
import ChartSmallDoughnutChart6 from './chart/ChartSmallDoughnutChart6';
import api from 'services/api';
import ChartLogsMonth from './chartLogsMonth';
import ChartLogsDays from './chartLogsDays';
import ChartOrdersMonth from './chartOrdersMonth';
import ChartOrdersDays from './chartOrdersDays';
import ChartNewOrganizationsMonth from './chartNewOrganizationsMonth';
import ChartNewOrganizationsDays from './chartNewOrganizationsDays';
import ChartOrdersByStatusMonth from './chartOrdersByStatusMonth';
import ChartOrdersByStatusDays from './chartOrdersByStatusDays';
import ChartOrdersByTypeMonth from './chartOrdersByTypeMonth';

const DashboardsAnalytic = () => {
    const title = 'Analytic Dashboard';
    const description = 'Analytic Dashboard';

    const breadcrumbs = [
        { to: '', text: 'Home' },
        { to: 'dashboards', text: 'Dashboards' },
    ]

    const [loading, setLoading] = useState(false)
    const [accessMonth, setAccessMonth] = useState(false)
    const [accessDays, setAccessDays] = useState(false)
    const [ordersMonth, setOrdersMonth] = useState(false)
    const [ordersDays, setOrdersDays] = useState(false)
    const [organizationsMonth, setOrganizationsMonth] = useState(false)
    const [organizationsDays, setOrganizationsDays] = useState(false)
    const [ordersByStatusMonth, setOrdersByStatusMonth] = useState(false)
    const [ordersByStatusDays, setOrdersByStatusDays] = useState(false)
    const [ordersByTypeMonth, setOrdersByTypeMonth] = useState(false)
    // const [ordersByTypeDays, setOrdersByTypeDays] = useState(false)


    const loadDashboard = async () => {
        setLoading(true)

        try {
            const response = await api.get(`/api/v1/private/dashboard/access`)

            let data_name = Object.keys(response.data)
            let data_value = Object.values(response.data)

            setAccessMonth({
                label: data_name,
                values: data_value
            })

        } catch (error) {

        }

        try {
            const response = await api.get(`/api/v1/private/dashboard/access?format=days`)

            let data_labels = []
            let data_values = []

            response.data.map((row) => {
                data_labels.push(row.day)
                data_values.push(row.total)
            })

            setAccessDays({
                label: data_labels,
                values: data_values
            })
        } catch (error) {

        }

        try {
            const response = await api.get(`/api/v1/private/dashboard/new_orders`)

            let data_name = Object.keys(response.data)
            let data_value = Object.values(response.data)

            setOrdersMonth({
                label: data_name,
                values: data_value
            })

        } catch (error) {

        }

        try {
            const response = await api.get(`/api/v1/private/dashboard/new_orders?format=days`)

            let data_labels = []
            let data_values = []

            response.data.map((row) => {
                data_labels.push(row.day)
                data_values.push(row.total)
            })

            setOrdersDays({
                label: data_labels,
                values: data_values
            })
        } catch (error) {

        }

        try {
            const response = await api.get(`/api/v1/private/dashboard/new_organizations`)

            let data_name = Object.keys(response.data)
            let data_value = Object.values(response.data)

            setOrganizationsMonth({
                label: data_name,
                values: data_value
            })

        } catch (error) {

        }

        try {
            const response = await api.get(`/api/v1/private/dashboard/new_organizations?format=days`)

            let data_labels = []
            let data_values = []

            // eslint-disable-next-line array-callback-return
            response.data.map((row) => {
                data_labels.push(row.day)
                data_values.push(row.total)
            })


            setOrganizationsDays({
                label: data_labels,
                values: data_values
            })

        } catch (error) {

        }

        try {
            const response = await api.get(`/api/v1/private/dashboard/orders_by_status`)
            setOrdersByStatusMonth(response.data)
        } catch (error) {

        }

        try {
            const response = await api.get(`/api/v1/private/dashboard/orders_by_status?format=days`)
            setOrdersByStatusDays(response.data)
        } catch (error) {

        }

        try {
            const response = await api.get(`/api/v1/private/dashboard/orders_by_type`)
            setOrdersByTypeMonth(response.data)
        } catch (error) {
        }

        // try {
        //     const response = await api.get(`/api/v1/private/dashboard/orders_by_type?format=days`)
        //     setOrdersByTypeDays(response.data)
        // } catch (error) {
        // }

        setLoading(false)
    }

    useEffect(() => {
        loadDashboard()
    }, [])


    return (
        <>
            <HtmlHead title={title} description={description} />
            {/* Title and Top Buttons Start */}
            <div className="page-title-container">
                <Row>
                    {/* Title Start */}
                    <Col md="7">
                        <h1 className="mb-0 pb-0 display-4">{title}</h1>
                        <BreadcrumbList items={breadcrumbs} />
                    </Col>
                    {/* Title End */}
                </Row>
            </div>
            {/* Title and Top Buttons End */}

            {loading
                ? <>
                    <div className="align-items-center">
                        <Spinner as="span" animation="border" size="md" />

                        <div>Carregando...</div>
                    </div>
                </>
                : <>
                    <Row className="g-2 mt-4">
                        <Col sm="6">
                            {!loading
                                ? <ChartLogsMonth data={accessMonth} />
                                : <></>
                            }

                        </Col>
                        <Col sm="6">
                            {!loading
                                ? <ChartLogsDays data={accessDays} />
                                : <></>
                            }

                        </Col>

                        <Col sm="12">
                            {!loading
                                ? <ChartOrdersByStatusMonth data={ordersByStatusMonth} />
                                : <></>
                            }

                        </Col>

                        <Col sm="6">
                            {!loading
                                ? <ChartOrdersMonth data={ordersMonth} />
                                : <></>
                            }

                        </Col>

                        <Col sm="6">
                            {!loading
                                ? <ChartOrdersDays data={ordersDays} />
                                : <></>
                            }
                        </Col>

                        <Col sm="12">
                            {!loading
                                ? <ChartOrdersByStatusDays data={ordersByStatusDays} />
                                : <></>
                            }
                        </Col>

                        <Col sm="12">
                            {!loading
                                ? <ChartOrdersByTypeMonth data={ordersByTypeMonth} />
                                : <></>
                            }

                        </Col>

                        <Col sm="6">
                            {!loading
                                ? <ChartNewOrganizationsMonth data={organizationsMonth} />
                                : <></>
                            }

                        </Col>

                        <Col sm="6">
                            {!loading
                                ? <ChartNewOrganizationsDays data={organizationsDays} />
                                : <></>
                            }

                        </Col>
                    </Row>
                </>
            }



        </>
    );
};

export default DashboardsAnalytic;
